    pattern = '(\\w+):(\\w+), (\\w+):(\\w+), (\\w+):(\\d+), (\\w+):(\\d+:\\d+:\\d+), (\\w+):(\\w+), (\\w+):(\\d+)'
    matches = re.match(pattern, schema_output)
    components = {matches.group(1): matches.group(2), matches.group(3): matches.group(4), matches.group(5): int(matches.group(6)), matches.group(7): matches.group(7), matches.group(9): matches.group(10), matches.group(11): int(matches.group(12))}
    return components

